import Navbar from "./components/navbar/navbar";
import Card from "./components/card/card";
import React from "react";
import './App.css';

function App() {
  return (
    <div class="container text-center">
      <Navbar />
      <h1 className="">Gallery</h1>
      <div class="row" >
        {Array.apply(null, { length: 9 }).map(() => {
          return <Card />
        })}
      </div>
    </div>
  );
}

export default App;
